import React from 'react'

import './DataCard.css'

const DataCard = props => {

    return(
        <div className="card">
            <div className="card__top">
                <p className="card__top-month"></p>
            </div>
            <div className="card__bottom">
                <div className="card__bottom-day-of-month"></div>
                <div className="card_bottom-day-of-week"></div>
            </div>
        </div>
    );

}

export default DataCard
